message:
たいしたことじゃないけど…quicksettingsが2行以上になった時に、スライダーの数字入力欄が上段に被るのを解消するcss
あとスライダーが端にくっつくのもモヤモヤするから左右に余白追加しといた。user.cssに以下をコピペ
#quicksettings {
padding: 0 10px;
}
#quicksettings > div,
#quicksettings > fieldset {
padding: 0 0 12px;
}
#quicksettings .gr-box > div > div > input.gr-text-input {
top: -0.6em;
}
